import React from 'react'
import NavBar from '../NavBar/NavBar';
import './Contact.scss';

export default function Contact() {
    return (
        <div className="contact">
            <NavBar />
            <p></p>
            <form className="contact__form">
                <input type="text" placeholder="Name" required/>
            </form>
        </div>
    )
}
